<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>28x28 Drawing Grid with Brush Effect</title>

    <style>
        canvas {
            border-style: dashed;
        }
    </style>

    <script src="https://cdnjs.cloudflare.com/ajax/libs/p5.js/1.4.0/p5.js"></script>
    <script src="build.em/toynet_wasm.js"></script>
    <script>
        const gridSize = 28;         // Number of cells in each row/column
        const cellSize = 20;         // Size of each cell in pixels
        let grid = [];

        function createGaussianBrush(size, sigma) {
            const kernel = [];
            const center = Math.floor(size / 2);
            let sum = 0;

            // Populate the kernel with Gaussian values
            for (let i = 0; i < size; i++) {
                kernel[i] = [];
                for (let j = 0; j < size; j++) {
                    const x = i - center;
                    const y = j - center;
                    const value = Math.exp(-(x * x + y * y) / (2 * sigma * sigma));
                    kernel[i][j] = value;
                    sum += value;
                }
            }

            // Normalize the kernel to make the sum of all values equal to 1
            for (let i = 0; i < size; i++) {
                for (let j = 0; j < size; j++) {
                    kernel[i][j] /= sum;
                }
            }

            return kernel;
        }

        const defaultBrush = createGaussianBrush(7, 1.0);

        let network;
        let inputVector;
        let feedforward_wrapper;

        createModule().then(Module => {
            const layers = new Module.IntList();
            layers.push_back(784);
            layers.push_back(30);
            layers.push_back(10);

            // Create an instance of MyClass
            network = new Module.Network(layers);
            inputVector = new Module.DoubleList();
            inputVector.resize(784, 0.0);

            network.load_parameters(document.getElementById('parametersString').textContent);
            console.log(`Network created!`);

            feedforward_wrapper = Module.feedforward_wrapper;
        });

        function setup() {
            createCanvas(gridSize * cellSize, gridSize * cellSize);
            background(255);
            // Initialize the grid with 0 opacity values for each cell
            for (let i = 0; i < gridSize; i++) {
                grid[i] = [];
                for (let j = 0; j < gridSize; j++) {
                    grid[i][j] = 0.0;  // Set initial opacity to 0 for each cell
                }
            }
        }

        function draw() {
            for (let i = 0; i < gridSize; i++) {
                for (let j = 0; j < gridSize; j++) {
                    // Draw each cell based on its current opacity level
                    let opacity = grid[i][j];
                    fill(0, 0, 0, opacity * 255);  // Scale opacity to range [0, 255]
                    noStroke();
                    rect(i * cellSize, j * cellSize, cellSize, cellSize);
                }
            }

            if (mouseIsPressed) {
                let i = floor(mouseX / cellSize);
                let j = floor(mouseY / cellSize);

                for (let k = 0; k < 7; k++) {
                    for (let l = 0; l < 7; l++) {
                        const x = i + k - 3;
                        const y = j + l - 3;
                        // Check if within bounds
                        if (x >= 0 && x < gridSize && y >= 0 && y < gridSize) {
                            // Increase the cell's opacity up to a maximum of 1
                            // grid[x][y] = min(grid[x][y] + defaultBrush[k][l] * 0.01, 1);
                            grid[x][y] = defaultBrush[k][l] > 0.05 ? 1.0 : 0.0;
                        }
                    }
                }
            }
        }

        function mouseReleased() {
            for (let row = 0; row < gridSize; row++) {
                for (let col = 0; col < gridSize; col++) {
                    // Draw each cell based on its current opacity level
                    let opacity = grid[col][row];
                    inputVector.set(row * gridSize + col, opacity);
                }
            }

            const output = feedforward_wrapper(network, inputVector);

            // Argmax
            let max = Number.MIN_VALUE;
            let predicted = 0;
            for (let i = 0; i < output.size(); i++) {
                const x = output.get(i);
                if (x > max) {
                    max = x;
                    predicted = i;
                }
            }

            document.getElementById("digit").textContent = predicted.toString();
        }

        function keyPressed() {
            if (key === 'c' || key === 'C') {
                // Clear the grid when 'C' is pressed
                for (let i = 0; i < gridSize; i++) {
                    for (let j = 0; j < gridSize; j++) {
                        grid[i][j] = 0;
                    }
                }
                background(255);
                document.getElementById("digit").textContent = '-';
            }
        }
    </script>
